import React, {Component} from 'react';
import {Link} from 'react-router-dom';


export default class TeamsPanel extends Component {

    constructor(props){
        super(props);
        this.state={
            teams:[]
        };
    }

    componentDidMount(){
        fetch('https://murmuring-tor-86528.herokuapp.com/teams')
        .then(response => {
            if (!response.ok) {
              throw new Error(response.statusText);
            }
            return response.json();
          })
        .then(data=>{
            function compare(property){
                return function(a,b){
                    var value1 = a[property];
                    var value2 = b[property];
                    return value1 - value2;
                }
            }
            console.log(data.sort(compare('_id')))
            console.log(data);
            this.setState({
                teams: data
            })
        }).catch(err=>{
            console.log(err);
        });
    }

    render(){
        var newData=[];
        newData=this.state.teams;
        console.log(newData);
        //newData.sort(compareValues('_id'));
        // function compare(property){
        //     return function(a,b){
        //         var value1 = a[property];
        //         var value2 = b[property];
        //         return value1 - value2;
        //     }
        // }
        // console.log(newData.sort(compare('_id')))
        // console.log(newData);
        return(
            <div className="panel panel-default">
                <div className="panel-heading">
                    <h3 className="panel-title">Teams</h3>
                </div>
                <div className="panel-body">
                    <div className="table-responsive overview-table">
                    <table className="table table-striped table-bordered">
                        <tbody>
                        {this.state.teams.map(teams=>{
                            return(
                                <tr key={teams._id}>
                                    <td>{teams.TeamName}</td>
                                    <td>{teams.Employees.length} Employees</td>
                                </tr>
                            );
                            })} 
                        </tbody>
                    </table>
                    </div>
                    <Link to="/teams" className="btn btn-primary form-control">View All Team Data</Link>
                </div>
            </div>
        )
    }
}
